import React from "react";
import ShowActivities from "../components/ShowActivities";
function Activity() {
  return (
    <div>
      <div className="carebox">
        <div>
          <h1 className="text-white abouth1 text-center">Activities</h1>
          {context.isInput == false ? (
            <button
              className="btn"
              onClick={() => {
                context.HandleIsInput();
              }}
            >
              Add Exercise
            </button>
          ) : (
            <InputActivity />
          )}
          <ShowActivities />
        </div>
      </div>
    </div>
  );
}

export default Activity;
